import './App.css';
import { BrowserRouter, Route, Routes } from 'react-router-dom';


function App() {
  return (
    <>
      <div className="wrapper">
        <BrowserRouter>
          <Routes>
            <Route path="" element={<Main/>} />
          </Routes>
        </BrowserRouter>
      </div>
    </>
  );
}

export default App;
